  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).
  The EnviroAtlas Tampa, FL land cover map was generated from USDA NAIP (National
  Agricultural Imagery Program) four band (red, green, blue and near infrared) aerial
  photography from April-May 2010 at 1 m spatial resolution. Eight land cover classes
  were mapped: impervious surface, soil and barren, grass and herbaceous, trees and
  forest, water, agriculture, woody wetland, and emergent wetland. The area mapped
  is defined by the US Census Bureau's 2010 Urban Statistical Area for Tampa, and
  includes the cities of Clearwater and St. Petersburg, as well as additional out-lying
  areas. An accuracy assessment using a stratified random sampling of 600 samples
  (100 per class) yielded an overall accuracy of 70.67 percent and an area weighted
  accuracy of 81.87 percent using a minimum mapping unit of 9 pixels (3x3 pixel window).
  This dataset was produced by the US EPA to support research and online mapping activities
  related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the
  user to interact with a web-based, easy-to-use, mapping application to view and
  analyze multiple ecosystem services for the contiguous United States. The dataset
  is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
